import { View, Text,StyleSheet,FlatList } from 'react-native'
import React from 'react'

 const Example=()=> {
    const names=[
        {key:1,name:"Ankit Dhakal" },
        {key:2,name:"Nikhil Thapa" },
        {key:3,name:"Rabin Thapa" },
        {key:4,name:"Seth Pariyar" },
        {key:5,name:"Alexis Subedi"} ,
        {key:6,name:"Dabeeg Rana" },
        {key:7,name:"Bishal Budhathoki"},
        {key:8,name:"Sushant Thapa"},


    ];
  return (
   
    <FlatList
    style={styles.itemStyle}
    keyExtractor={(index)=> {  //external key extractor
        return index.key;
}}

    data={names}
    renderItem={(element)=>{
        return (
            <View>
        <Text style= {styles.textStyle}
             >{element.item.name}</Text>
        </View>
        )
    }}
    />


    
  )
}
const styles= StyleSheet.create({
    textStyle:{
        fontSize: 20,
        backgroundColor:"yellow",
        margin:20
    },
    itemStyle:{
     textAlign:"center",
     margin:20,
     padding:10
    }

});


export default Example;
